  // get Lookup Value Column
  bmlfGetInputColumn(psField, index) {
    if (psField == 'TemplateItemKey' || psField == 'RMTemplateItemKey') {
      return 'ItemKey';
    } else if (psField == 'ItemSubTyp') {
      return 'ItemSubTyp';
    } else if (psField == 'ItemKey' && this.marrItemWiseGridData[index].LineType == "Material") {
      return 'ItemKey';
    } else if (psField == 'ItemKey' && this.marrItemWiseGridData[index].LineType == "Boiler Plate") {
      return 'BoilerPlateId';
    } else if (psField == 'ItemKey' && this.marrItemWiseGridData[index].LineType == "Labor") {
      return 'LaborCostId';
    } else if (psField == 'FGTemplateItemKey' || psField == 'FGItemKey') {
      return 'Assembly_Item_Key';
    }
  }
  bmlfClearLookupField(psField, index) {
    if (psField == "smSampleSizeUOM") {
      this.mobjLabBatchModel.smSampleSizeUOM = "";
    } else if (psField == "smFormulaID") {
      this.mobjLabBatchModel.smFormulaID = "";
      this.mobjLabBatchModel.smFormulaSeqNo = "";
    } else if (psField == "smBomItemKey") {
      this.mobjLabBatchModel.smBomItemKey = "";
      this.mobjLabBatchModel.smBomLocation = "";
    } else if (psField == "smBatchNo") {
      this.mobjLabBatchModel.smBatchNo = "";
    } else if (psField == "ManPowerId") {
      this.mobjLabBatchModel.ManPowerId = "";
    } else if (psField == "smItemKey") {
      this.marrItemWiseGridData[index].smItemKey = '';
      this.marrItemWiseGridData[index].ItemDescription = '';
      this.marrItemWiseGridData[index].smItemLocationKey = '';
      this.marrItemWiseGridData[index].ItemSubTyp = '';
      this.marrItemWiseGridData[index].smItemUOM = '';
      this.bmlfCalculateTotals();
    } else if (psField == "TemplateItemKey") {
      this.marrItemWiseGridData[index].TemplateItemKey = "";
      this.marrItemWiseGridData[index].TemplateLocation = "";
    } else if (psField == "smItemUOM") {
      this.mobjLabBatchModel.smItemUOM = "";
    }
  }
  // Transfer Lookup Values
  bmlfonTransferValues(psFName, pobjValue) {
    switch (psFName) {
      case 'smSampleSizeUOM':
        {
          this.mobjLabBatchModel.smSampleSizeUOM = pobjValue['UomKey'];
          break;
        }
      case 'smFormulaID':
        {
          this.mobjLabBatchModel.smFormulaID = pobjValue['FormulaId'];
          this.mobjLabBatchModel.smFormulaSeqNo = pobjValue['RevisionNumber'];
          break;
        }
      case 'smBomItemKey':
        {
          this.mobjLabBatchModel.smBomItemKey = pobjValue['Assembly_Item_Key'];
          this.mobjLabBatchModel.smBomLocation = pobjValue['Assembly_Location'];
          break;
        }
      case 'smBatchNo':
        {
          this.mobjLabBatchModel.smBatchNo = pobjValue['Batchno'];
          break;
        }
      case 'ManPowerId':
        {
          this.mobjLabBatchModel.ManPowerId = pobjValue['smManPowerId'];
          break;
        }
      case 'smItemKey':
        {
          if (this.marrItemWiseGridData[this.mnumLineItemRowIndex].smCostType == 'Formula Cost' || this.marrItemWiseGridData[this.mnumLineItemRowIndex].smCostType == 'Container Cost') {
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].smItemKey = pobjValue['ItemKey'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].ItemDescription = pobjValue['Desc1'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].smItemLocationKey = pobjValue['Location'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].ItemSubTyp = pobjValue['ItemSubtyp'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].smItemUOM = pobjValue['StockUomCode'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].StdCost = Number(pobjValue['StdCost']);
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].AvgCost = Number(pobjValue['AvgCost']);
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].LstCost = Number(pobjValue['LstCost']);
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].MarketCost = Number(pobjValue['MarketCost']);
            if (this.msCostingMethod == 'STANDARD') {
              this.marrItemWiseGridData[this.mnumLineItemRowIndex].smItemRate = Number(pobjValue['StdCost']);
            } else if (this.msCostingMethod == 'AVERAGE') {
              this.marrItemWiseGridData[this.mnumLineItemRowIndex].smItemRate = Number(pobjValue['AvgCost']);
            } else if (this.msCostingMethod == 'LAST') {
              this.marrItemWiseGridData[this.mnumLineItemRowIndex].smItemRate = Number(pobjValue['LstCost']);
            } else if (this.msCostingMethod == 'MARKET') {
              this.marrItemWiseGridData[this.mnumLineItemRowIndex].smItemRate = Number(pobjValue['MarketCost']);
            }
          } else {
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].smItemKey = pobjValue['LaborCostId'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].ItemDescription = pobjValue['Description'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].smItemRate = pobjValue['CostAmount'];
          }
          this.bmlfChangeQty(this.marrItemWiseGridData[this.mnumLineItemRowIndex], this.mnumLineItemRowIndex, '');
          break;
        }
      case 'ItemSubTyp':
        {
          this.marrItemWiseGridData[this.mnumLineItemRowIndex].ItemSubTyp = pobjValue['ItemSubTyp'];
          break;
        }
      case 'smItemUOM':
        {
          this.marrItemWiseGridData[this.mnumLineItemRowIndex].smItemUOM = pobjValue['UomKey'];
          break;
        }
      // case 'TemplateItemKey': {
      //   this.marrItemWiseGridData[this.mnumLineItemRowIndex].TemplateItemKey = pobjValue['ItemKey'];
      //   this.marrItemWiseGridData[this.mnumLineItemRowIndex].TemplateLocation = pobjValue['Location'];
      //   break;
      // }
      default:
        {
          break;
        }
    }
  }
