  bmlfValidLineItem(type = '') {
    let psErrMsg = "";
    if (this.marrItemWiseGridData.length == 0 && type == '') {
      psErrMsg = this.utilService.bmgfonTranslate("SAMPLETRANS.MSG.ADDLINE");
    } else {
      for (let i = 0; i < this.marrItemWiseGridData.length; i++) {
        if (src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_2__.CustomValidator.bmgfNullCheckValidator(this.marrItemWiseGridData[i].smItemKey) && this.marrItemWiseGridData[i].smCostDetailSumm != 'Summary') {
          if (this.marrItemWiseGridData[i].smCostType == 'Formula Cost' || this.marrItemWiseGridData[i].smCostType == 'Container Cost') {
            psErrMsg = this.utilService.bmgfonTranslate("SAMPLETRANS.MSG.ITEMKEYREQ") + " " + this.utilService.bmgfonTranslate("SAMPLETRANS.ATROW") + (i + 1);
            break;
          } else if (this.marrItemWiseGridData[i].smCostType == 'Labor Expenses') {
            psErrMsg = this.utilService.bmgfonTranslate("SAMPLETRANS.MSG.LABORKEYREQ") + " " + this.utilService.bmgfonTranslate("SAMPLETRANS.ATROW") + (i + 1);
            break;
          } else if (this.marrItemWiseGridData[i].smCostType == 'Lab Expenses' || this.marrItemWiseGridData[i].smCostType == 'Miscellaneous') {
            psErrMsg = this.utilService.bmgfonTranslate("SAMPLETRANS.MSG.TEXTREQ") + " " + this.utilService.bmgfonTranslate("SAMPLETRANS.ATROW") + (i + 1);
            break;
          } else {
            psErrMsg = "";
          }
        }
      }
    }
    if (psErrMsg != "") {
      this.toastMessageService.notifyError(psErrMsg);
      return false;
    } else {
      return true;
    }
  }
