  // Transfer Lookup Values
  bmlfonTransferValues(psFName, pobjValue) {
    switch (psFName) {
      case 'FGItemKey':
        {
          this.mobjTabNoteBookData.FGItemKey = pobjValue['Assembly_Item_Key'];
          this.mobjTabNoteBookData.FGLocationKey = pobjValue['Assembly_Location'];
          break;
        }
      case 'FGTemplateItemKey':
        {
          this.mobjTabNoteBookData.FGTemplateItemKey = pobjValue['Assembly_Item_Key'];
          this.mobjTabNoteBookData.FGTemplateLocationKey = pobjValue['Assembly_Location'];
          this.mobjTabNoteBookData.FGLocationKey = pobjValue['Assembly_Location'];
          break;
        }
      case 'RMTemplateItemKey':
        {
          this.mobjTabNoteBookData.RMTemplateItemKey = pobjValue['ItemKey'];
          this.mobjTabNoteBookData.RMTemplateLocationKey = pobjValue['Location'];
          break;
        }
      case 'ItemKey':
        {
          if (this.marrItemWiseGridData[this.mnumLineItemRowIndex].LineType == "Material") {
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].ItemKey = pobjValue['ItemKey'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].Description = pobjValue['Desc1'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].ItemSubTyp = pobjValue['ItemSubtyp'];
            //this.marrItemWiseGridData[this.mnumLineItemRowIndex].Cost = pobjValue['StdCost'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].Location = pobjValue['Location'];
            // this.marrItemWiseGridData[this.mnumLineItemRowIndex].TemplateLocation = pobjValue['Location'];
            if (this.msCostingMethod == 'STANDARD') {
              this.marrItemWiseGridData[this.mnumLineItemRowIndex].Cost = Number(pobjValue['StdCost']);
            } else if (this.msCostingMethod == 'AVERAGE') {
              this.marrItemWiseGridData[this.mnumLineItemRowIndex].Cost = Number(pobjValue['AvgCost']);
            } else if (this.msCostingMethod == 'LAST') {
              this.marrItemWiseGridData[this.mnumLineItemRowIndex].Cost = Number(pobjValue['LstCost']);
            } else if (this.msCostingMethod == 'MARKET') {
              this.marrItemWiseGridData[this.mnumLineItemRowIndex].Cost = Number(pobjValue['MarketCost']);
            }
            this.bmlfGetSysWtVolConversion();
          } else if (this.marrItemWiseGridData[this.mnumLineItemRowIndex].LineType == "Labor") {
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].ItemKey = pobjValue['LaborCostId'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].Description = pobjValue['Description'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].Cost = pobjValue['CostAmount'];
          } else if (this.marrItemWiseGridData[this.mnumLineItemRowIndex].LineType == "Boiler Plate") {
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].ItemKey = pobjValue['BoilerPlateId'];
            this.marrItemWiseGridData[this.mnumLineItemRowIndex].Description = pobjValue['BoilerPlateText'];
          }
          break;
        }
      case 'ItemSubTyp':
        {
          this.marrItemWiseGridData[this.mnumLineItemRowIndex].ItemSubTyp = pobjValue['ItemSubTyp'];
          break;
        }
      case 'TemplateItemKey':
        {
          this.marrItemWiseGridData[this.mnumLineItemRowIndex].TemplateItemKey = pobjValue['ItemKey'];
          this.marrItemWiseGridData[this.mnumLineItemRowIndex].TemplateLocation = pobjValue['Location'];
          break;
        }
      case 'FetchItems':
        {
          this.mbRevisionNumber = pobjValue["RevisionNumber"]; // new add
          if (this.marrItemWiseGridData.length > 0) {
            this.mbDeleteExistingLinesDialog = true;
            this.mobjFetchFormulaData = pobjValue;
            this.mobjFetchFormulaData.SpecifyQty = 0;
            this.mobjTabNoteBookData.FormulaKey = pobjValue["FormulaId"];
          } else {
            this.mobjFetchFormulaData = pobjValue;
            this.mobjFetchFormulaData.SpecifyQty = 0;
            this.mobjTabNoteBookData.FormulaKey = pobjValue["FormulaId"];
            this.mbSpecifyQtyDialog = true;
            this.mobjFetchFormulaData.DeleteExistItem = "Yes";
          }
          break;
        }
      default:
        {
          break;
        }
    }
  }
  // get Lookup Value Column
  bmlfGetInputColumn(psField, index) {
    if (psField == 'TemplateItemKey' || psField == 'RMTemplateItemKey') {
      return 'ItemKey';
    } else if (psField == 'ItemSubTyp') {
      return 'ItemSubTyp';
    } else if (psField == 'ItemKey' && this.marrItemWiseGridData[index].LineType == "Material") {
      return 'ItemKey';
    } else if (psField == 'ItemKey' && this.marrItemWiseGridData[index].LineType == "Boiler Plate") {
      return 'BoilerPlateId';
    } else if (psField == 'ItemKey' && this.marrItemWiseGridData[index].LineType == "Labor") {
      return 'LaborCostId';
    } else if (psField == 'FGTemplateItemKey' || psField == 'FGItemKey') {
      return 'Assembly_Item_Key';
    }
  }
