  bmlfCalculateTotals() {
    this.mobjTotalValues.TotalFormulaWt = 0;
    this.mobjTotalValues.TotalFormulaVol = 0;
    this.mobjTotalValues.TotalRMCost = 0;
    if (this.mobjTabNoteBookData.EntrybyWtVol == 0 || this.mobjTabNoteBookData.EntrybyWtVol == 2) {
      let pnumTotalQtyInWt = this.marrItemWiseGridData.filter(item => item.LineType == "Material" || item.LineType == "New Item").reduce((sum, current) => sum + current.WtQty, 0);
      this.mobjTotalValues.TotalFormulaWt = pnumTotalQtyInWt;
      let pnumTotalQtyInVol = this.marrItemWiseGridData.filter(item => item.LineType === "Material" || item.LineType === "New Item").reduce((sum, current) => sum + current.VolQty, 0);
      this.mobjTotalValues.TotalFormulaVol = pnumTotalQtyInVol;
    } else if (this.mobjTabNoteBookData.EntrybyWtVol == 1) {
      let pnumTotalQtyInWtPer = this.marrItemWiseGridData.filter(item => item.LineType == "Material" || item.LineType == "New Item").reduce((sum, current) => sum + current.WtPer, 0);
      this.mobjTotalValues.TotalFormulaWt = pnumTotalQtyInWtPer;
      let pnumTotalQtyInVolPer = this.marrItemWiseGridData.filter(item => item.LineType === "Material" || item.LineType === "New Item").reduce((sum, current) => sum + current.VolPer, 0);
      this.mobjTotalValues.TotalFormulaVol = pnumTotalQtyInVolPer;
    }
    let pnumTotalCost = this.marrItemWiseGridData.filter(item => item.LineType === "Material" || item.LineType === "New Item").reduce((sum, current) => sum + Number(current.Amount), 0);
    this.mobjTotalValues.TotalRMCost = pnumTotalCost;
    if (this.mobjTotalValues.TotalFormulaVol > 0) {
      this.mobjTotalValues.TotalSystemWt = this.mobjTotalValues.TotalFormulaWt / this.mobjTotalValues.TotalFormulaVol;
    } else {
      this.mobjTotalValues.TotalSystemWt = 0;
    }
  }
  bmlfChangeQty(data, index, field) {
    if ((field == "WtQty" || field == "BakerWtQty") && data.oldWtQty == data.WtQty) {
      return;
    }
    if ((field == "VolQty" || field == "BakerVolQty") && data.oldVolQty == data.VolQty) {
      return;
    }
    if (field == "WtPer" && data.oldWtPer == data.WtPer) {
      return;
    }
    if (field == "VolPer" && data.oldVolPer == data.VolPer) {
      return;
    }
    if (data.LineType == "Material") {
      if (field == "WtQty" || field == "BakerWtQty") {
        let pnumCalVolQty = data.WtQty * data.InvConFact;
        this.marrItemWiseGridData[index].VolQty = pnumCalVolQty;
        this.marrItemWiseGridData[index].oldVolQty = pnumCalVolQty;
      } else if (field == "VolQty" || field == "BakerVolQty") {
        let pnumCalWtQty = 0;
        if (Number(data.InvConFact) > 0) {
          pnumCalWtQty = Number(data.VolQty) / Number(data.InvConFact);
        }
        this.marrItemWiseGridData[index].WtQty = pnumCalWtQty;
        this.marrItemWiseGridData[index].oldWtQty = pnumCalWtQty;
      } else if (field == "WtPer") {
        let pnumCalVolPer = data.WtPer * data.InvConFact;
        this.marrItemWiseGridData[index].VolPer = pnumCalVolPer;
        this.marrItemWiseGridData[index].oldVolPer = pnumCalVolPer;
      } else if (field == "VolPer") {
        let pnumCalWtPer = 0;
        if (Number(data.InvConFact) > 0) {
          pnumCalWtPer = Number(data.VolPer) / Number(data.InvConFact);
        }
        this.marrItemWiseGridData[index].WtPer = pnumCalWtPer;
        this.marrItemWiseGridData[index].oldWtPer = pnumCalWtPer;
      } else if (field == "BakerPercentage") {
        let pnumTotalBaseQtyInWt = this.marrItemWiseGridData.filter(item => item.BaseItem == true).reduce((sum, current) => sum + current.WtQty, 0);
        let pnumTotalBaseQtyInVol = this.marrItemWiseGridData.filter(item => item.BaseItem == true).reduce((sum, current) => sum + current.VolQty, 0);
        let pnumCalWtQty = data.BakerPercentage * pnumTotalBaseQtyInWt / 100;
        let pnumCalVolQty = data.BakerPercentage * pnumTotalBaseQtyInVol / 100;
        this.marrItemWiseGridData[index].VolQty = pnumCalVolQty;
        this.marrItemWiseGridData[index].WtQty = pnumCalWtQty;
      }
    } else if (data.LineType == "Labor" || data.LineType == "New Item") {
      if (field == "WtQty") {
        this.marrItemWiseGridData[index].VolQty = src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_2__.CustomValidator.bmgfZeroValueValidator(data.VolQty) ? data.WtQty : data.VolQty;
      } else if (field == "VolQty") {
        this.marrItemWiseGridData[index].WtQty = src_app_core_services_custom_validators__WEBPACK_IMPORTED_MODULE_2__.CustomValidator.bmgfZeroValueValidator(data.WtQty) ? data.VolQty : data.WtQty;
      } else if (field == "BakerPercentage") {
        if (data.LineType == "New Item") {
          let pnumTotalBaseQtyInWt = this.marrItemWiseGridData.filter(item => item.BaseItem == true).reduce((sum, current) => sum + current.WtQty, 0);
          let pnumTotalBaseQtyInVol = this.marrItemWiseGridData.filter(item => item.BaseItem == true).reduce((sum, current) => sum + current.VolQty, 0);
          let pnumCalWtQty = data.BakerPercentage * pnumTotalBaseQtyInWt / 100;
          let pnumCalVolQty = data.BakerPercentage * pnumTotalBaseQtyInVol / 100;
          this.marrItemWiseGridData[index].VolQty = pnumCalVolQty;
          this.marrItemWiseGridData[index].WtQty = pnumCalWtQty;
        }
      }
    }
    if (field == "WtPer" || field == "VolPer") {
      let pnumCalAmt = data.WtPer * data.Cost;
      this.marrItemWiseGridData[index].Amount = this.utilService.bmgfSetPrecision(pnumCalAmt, this.miAmountPrecision);
    } else {
      let pnumCalAmt = data.WtQty * data.Cost;
      this.marrItemWiseGridData[index].Amount = this.utilService.bmgfSetPrecision(pnumCalAmt, this.miAmountPrecision);
    }
    if (data.LineType == "Material" || data.LineType == "New Item") {
      /**--this code for calculate qty if we change base item qty ----- */
      if (data.BaseItem == true && field == "BakerWtQty") {
        this.marrItemWiseGridData.forEach(element => {
          if (element.BaseItem == false && (element.LineType == "Material" || element.LineType == "New Item")) {
            let pnumTotalBaseQtyInWt = data.WtQty;
            let pnumCalBakerPer = element.BakerPercentage * pnumTotalBaseQtyInWt / 100;
            element.WtQty = pnumCalBakerPer;
            let pnumCalVolQty = element.WtQty * element.InvConFact;
            element.VolQty = pnumCalVolQty;
          }
        });
      }
      /**------------ */
    }
    // if (field == "Cost") {
    //   if (data.LineType == "Material" || data.LineType == "New Item" || data.LineType == "Labor") {
    //     this.marrItemWiseGridData[index].User4 = "USER DEFINED";
    //   }
    // }
    this.bmlfCalculateTotals();
  }
