  bmlfConvertWtVolAction(type) {
    this.mbConvertWtVolDialog = false;
    if (this.mobjTabNoteBookData.EntrybyWtVol == 1) {
      if (type == "Yes") {
        this.marrItemWiseGridData.forEach(ele => {
          if (ele.LineType == "Material" || ele.LineType == "New Item") {
            let pnumWtPer = this.utilService.bmgfSetPrecision(ele.WtQty / this.mobjTotalValues.TotalFormulaWt * 100, 2); // buf fix-170362
            ele.WtPer = Number(pnumWtPer);
            let pnumVolPer = this.utilService.bmgfSetPrecision(ele.VolQty / this.mobjTotalValues.TotalFormulaWt * 100, 2);
            ele.VolPer = Number(pnumVolPer);
            let pnumCalAmt = ele.WtPer * ele.Cost;
            ele.Amount = this.utilService.bmgfSetPrecision(pnumCalAmt, this.miAmountPrecision);
          } else {
            ele.WtPer = ele.WtQty;
            ele.VolPer = ele.VolQty;
          }
        });
      } else {
        this.marrItemWiseGridData.forEach(ele => {
          ele.WtPer = ele.WtQty;
          ele.VolPer = ele.VolQty;
        });
      }
    } else if (this.mobjTabNoteBookData.EntrybyWtVol == 0) {
      if (type == "Yes") {
        this.marrItemWiseGridData.forEach(ele => {
          ele.WtQty = ele.WtPer;
          ele.VolQty = ele.VolPer;
        });
      } else {}
    }
    this.bmlfCalculateTotals();
  }
